import AboutMe from './Aboutme'
import Contact from './Contacts'
import Projects from './Project'
import Resume from './Resume'


const Main = () => (
    <Switch>
        <Route exact path= "/" componant= {LandingPage} />

    </Switch>
);

export default Main;
